import React, { Component } from "react";

class Person extends Component {
  constructor(props) {
    super(props);
    this.props = props;
    this.state = {
      name: "John",
      age: 23,
    };
  }
  render() {
    return (
      <div>
        <div>
          My name is {this.state.name} and My age is {this.state.age}
        </div>
      </div>
    );
  }
}

export default Person;
